import React, { Component } from 'react'

export default class DinoPicker extends Component {
    render() {
        return (
            <div>
                <h1>Dino Picker</h1>
                <div className='dinoPicker'>
                    <img src="../img/red_dino_short.gif" alt="dino"/>
                    <img src="../img/yellow_dino_short.gif" alt="dino"/>
                    <img src="../img/green_dino_short.gif" alt="dino"/>
                    <img src="../img/blue_dino_short.gif" alt="dino"/>
                </div>
            </div>
        )
    }
}
